INSERT INTO `Tooltip` (`id`, `tooltip`) VALUES
(1, 'Lorsque tu captures un Monstre, il est à toi... Tu penses que tu peux l\'utiliser ? Attention quand même car on peut te le reprendre.'),
(2, 'Tu peux reprendre de la vie en consommant des fruits !'),
(3, 'Tu peux équiper ton personnage d une arme si tu trouve des equipements de type arme '),
(4, 'Quand vous équipez une armure, celle ci réduit les dégâts brutes causés par un ennemie selon le pourcentage affiché à coté de votre vie.'),
(5, 'Les Items pop près de toi quand tu farmes donc ne t\'éloigne pas trop'),
(6, 'Au début du jeu il vaut mieux trouver une arme et une armure et faire une provision de fruit avant de se battre'),
(7, 'Quand tu trouve une armes identique à une autre et de même niveau , elle fusionne en une arme de plus gros lvl .... c\'est Enorme !!'),
(8, 'Il y à 2 type d\'attaque , Les Armes standards et les Attaques Magic il faut s\'équiper d\'une Arme ou d\'un pouvoir. Attention selon ton type de perso avoir une arme ou un pouvoir change tout.'),
(9, 'Au niveau 2 lvl 2 , tu débloques ta première compétence !!'),
(10, 'Pour gagner des lbl, il faut faire de l\'xp... Pour gagner de xp il faut Attaquer des Mobs'),
(11, 'Plus in item sur le sol est vert et plus il est commun. Plus il roussi plus il est rare !!!');
